#!/bin/bash

# The aim of this script is to be stupidly long.  Longer than 32768 bytes, which was a
# serious problem for the previous JschInvoker.
# Now the JSCH invoker breaks us into little pieces (5000 characters).
# The bulk of this script creates a temporary file which contains sequences "0123456".
# The thinking is that 5000 isn't an exact multiple of this seven character length. If
# any part of this script is lost (just a few bytes here or there), we will end up writing
# a partial sequence, so the grep at the end of this script (i.e. which searches for
# everything which is not 0123456 etc.) will succeed and the test will fail.

TMP=/tmp/.output.$$
trap "rm -f $TMP" EXIT
cat > $TMP <<EOF
